import { NavLink } from 'react-router-dom';

function Header() {
  const linkClass = ({ isActive }) =>
    isActive ? 'neon-active' : 'neon-text';

  return (
    <header style={styles.header}>
      <div style={styles.logo}>âš¡ Phone Catalog</div>

      <nav style={styles.nav}>
        <NavLink to="/" className={linkClass}>Home</NavLink>
        <NavLink to="/phones" className={linkClass}>Phones</NavLink>
        <NavLink to="/tablets" className={linkClass}>Tablets</NavLink>
        <NavLink to="/accessories" className={linkClass}>Accessories</NavLink>
        <NavLink to="/cart" className={linkClass}>Cart</NavLink>
        <NavLink to="/favorites" className={linkClass}>Favorites</NavLink>
      </nav>
    </header>
  );
}

const styles = {
  header: {
    padding: '16px 32px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    borderBottom: '1px solid rgba(255,255,255,0.08)',
  },
  logo: {
    fontWeight: 500,
    letterSpacing: '1px',
  },
  nav: {
    display: 'flex',
    gap: '20px',
    fontSize: '14px',
  },
};

export default Header;
